const Alphabetize = require('./alphabetize');
const alph = new Alphabetize();

const obj = {
	"Butnot": 1,
	"Alphabetical": 2,
	"Currently": 3
}

const orderedObj = {
	"Alphabetical": 2,
	"Butnot": 1,
	"Currently": 3
}

test('Sorts unalphabetized json keys into alphabetized order by first letter', () => {
	expect(alph.order(obj)).toEqual(orderedObj)
})
